import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

const Formate = () => {
  const [arr, setarr] = useState([]);

  useEffect(() => {
    try {
      const get_date = localStorage.getItem("Data");
      const data_is = get_date ? JSON.parse(get_date) : [];
      setarr(data_is);
    } catch (error) {
      console.error("Error parsing data from localStorage:", error);
      setarr([]); // Set an empty array or handle the error appropriately
    }
  }, []);

  // Function to handle deletion of an item
  const handleDelete = (index) => {
    // Implement the logic to remove the item from arr and update localStorage
  };

  return (
    <>
      {arr?.length === 0 ? (
        <tr>
          <td colSpan="8">No Data Found</td>
        </tr>
      ) : (
        <>
          {arr.map((item, ind) => (
            <tr key={ind}>
              <td>{item.first_name}</td>
              {/* Render other fields */}
              <td>
                <Link to={"/AddProfile"} state={{ data: item }}>
                  Edit
                </Link>
                <button onClick={() => handleDelete(ind)}>Delete</button>
              </td>
            </tr>
          ))}
        </>
      )}
    </>
  );
};

export default Formate;
